export const FOLDERS = {
  users: "Пользователи",
  profile: "Профиль",
  objects: "Объекты",
  account: "Баланс",
};

export const ROUTES = {
  auth: "/",
  layout: "/*",
  users: "/user",
  objects: "/objects",
  profile: "/profile",
  object: "/objects/:id",
  user: "users/:id",
};
